import { FunctionComponent } from "react";
import StyleButtons from "./Css/Buttons.module.css";

type ButtonsType = {
  onClick? (): void;
  Text?: string | any;
  type?:string;

  IconEnd?: string;
  IconStart?: string;

  TextAlign?: string;
  ButtonColor?: string;
  TextColor?: string;
  BorderColor?: string;
  BorderRadius?: number;
  Max?: string;
};

const Buttons: FunctionComponent<ButtonsType> = ({
  onClick,
  Text,
  type,
  IconEnd,
  IconStart,
  TextAlign,
  ButtonColor,
  TextColor,
  BorderColor,
  BorderRadius,
  Max
}) => {

  // let SideBar = document.getElementById("SideBar");

  // if(SideBar!=null)
  // {

  // }
  let cssBotao = "";

  if(BorderRadius != 0 && BorderRadius != null){
    cssBotao = " border-radius: " + BorderRadius +"px";
  }else{
    cssBotao = StyleButtons.Button;
  }


  return (
    <div className={StyleButtons.button} onClick={onClick}>
      <div className={StyleButtons.iconstart}>
        <img className={StyleButtons.vectorIcon} alt="" src={IconStart} />
      </div>
      <div className={StyleButtons.text}>{Text}</div>
      <div className={StyleButtons.iconend}>
        <img className={StyleButtons.vectorIcon} alt="" src={IconEnd} />
      </div>
    </div>
  );
};

export default Buttons;
